import React from 'react'
import User from './User'

class App extends React.Component {
  constructor() {
		super();
		this.state = {
      user1: {name: 'Иван1', surname: 'Иванов1'},
      user2: {name: 'Иван2', surname: 'Иванов2'},
      user3: {name: 'Иван3', surname: 'Иванов3'}
    }
	}

	render() {
		return <div>
			<User name={this.state.user1.name} surname={this.state.user1.surname} />
			<User name={this.state.user2.name} surname={this.state.user3.surname} />
			<User name={this.state.user3.name} surname={this.state.user3.surname} />
		</div>;
	}
}

export default App;
